import React from "react";

const Card = (props) => {
  return (
    <div className="bg-light-green dib br3 pa3 ma2 grow bw2 shaddow-5">
      <img
        src="https://img-9gag-fun.9cache.com/photo/a9Ro92K_460swp.webp"
        height="200"
        width="200"
        alt="meme1"
      ></img>
      <div>
        <h2>{props.name}</h2>
        <p>{props.email}</p>
      </div>
    </div>
  );
};

export default Card;
